import React from "react";
import "../styles/home.css";
import { Container, Row, Col } from "reactstrap";
import heroImg from "../assets/images/hero-img01.jpg";
import heroImg02 from "../assets/images/hero-img02.jpg";
import heroVideo from "../assets/images/hero-video.mp4";
import Subtitle from "../shared/Subtitle";
import worldImg from "../assets/images/world.png";

function Home() { 
  return (
    <>
      <section>
        <Container>  {/* Added Container for proper structure */}
          <Row>
            <Col lg="6">
              <div className="hero__content">
                <div className="hero__subtitle d-flex align-items-center">
                  <Subtitle subtitle={'know before you go'} />
                  <img src={worldImg} alt="world icon" />
                </div>
                <h1>Travelling opens the door to creating <span className="highlight">memories</span></h1>
                <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Iure, architecto! Exercitationem adipisci ullam, velit qui voluptatem inventore, saepe laudantium ab earum molestiae obcaecati est cum ut molestias repellat doloribus dolor!</p>
              </div>
            </Col>

            <Col lg="2">
            <div className="hero__img-box">
                <img src={heroImg}/>
            </div>
            </Col>
            <Col lg="2">
            <div className="hero__img-box mt-4">
                <video src={heroVideo}alt=""controls/>
            </div>
            </Col>
            <Col lg="2">
            <div className="hero__img-box mt-5">
                <img src={heroImg02}/>
            </div>
            </Col>
          </Row>
        </Container>
      </section>
    </>
  );
}

export default Home;
